    storeCheckHUD(v) {
      this.$cookies.set('checkHUD', v, {
        path: '/',
        maxAge: 60 * 60 * 24 * 7
      })
    },
    selectRegions(){
      this.isCheckAll = !this.isCheckAll;
      if(this.isCheckAll){ // Check all
        this.viewCheckbox = {
          tiranoc: true,
          nagarythe: true,
          caledor: true,
          khaine: true,
          ellyrion: true,
          phenix: true,
          eataine: true,
          avelorn: true,
          saphery: true,
          chrace: true,
          loec: true,
          yvresse: true
        }
      } else {
        this.viewCheckbox = {
          tiranoc: false,
          nagarythe: false,
          caledor: false,
          khaine: false,
          ellyrion: false,
          phenix: false,
          eataine: false,
          avelorn: false,
          saphery: false,
          chrace: false,
          loec: false,
          yvresse: false
        }
      }
    },
    updateInfo(value) {
      this.title = value;
      this.region = value;
      this.isShowModal = true;
    },
    getInfo(e) {
      this.title = e.target.id;
      this.region = e.target.getAttribute("aria-valuetext") ? e.target.getAttribute("aria-valuetext") : "";
    },
    toggleModal(e) {
      if (e && e.target.getAttribute("aria-valuetext")) {
        this.regionMobile = e.target.getAttribute("aria-valuetext");
        this.isShowModal = !this.isShowModal;
      } else {
        this.isShowModal = !this.isShowModal;
      }
    },
  },
  async fetch() {
    this.displayHUDValue = this.$cookies.get('checkHUD');
    this.loading = true;
    let map1 = require(`~/static/totalwar/map.json`);
    this.mapsettings = map1
    console.log(this.mapsettings, "dkeodk, ,,")
    
    let testApi = await this.$http.$get(
      "https://api.npoint.io/e2fd8ae0b04e7c27244b"
      ); //API
      
    console.log(testApi.factions)
    let factions = testApi.factions
    let time = testApi.time
    this.result = testApi.results


    function MergeRecursive(obj1, obj2) {
      for (var p in obj2) {
        try {
          // Property in destination object set; update its value.
          if (obj2[p].constructor==Object ) {
            obj1[p] = MergeRecursive(obj1[p], obj2[p]);

          } else {
            obj1[p] = obj2[p];

          }

        } catch(e) {
          // Property in destination object not set; create it and set its value.
          obj1[p] = obj2[p];

        }
      }

      return obj1;
    }

    let o3 = MergeRecursive(map1, testApi);

    

    this.map = o3
    this.currentMap = o3
    this.tour = time.tour;
    this.currentTour = this.tour
    this.loading = false;
    
  },
};
